from typing import List

class Solution:
    def maxNumberOfAlloys(self, n: int, k: int, budget: int, composition: List[List[int]], stock: List[int], cost: List[int]) -> int:
        max_alloys = 0
        for machine in range(k):
            total_cost = 0
            for metal in range(n):
                needed = composition[machine][metal] - stock[metal]
                if needed > 0:
                    total_cost += needed * cost[metal]
            if total_cost <= budget:
                max_alloys_for_machine = budget // total_cost if total_cost > 0 else float('inf')
                for metal in range(n):
                    if composition[machine][metal] > 0:
                        max_alloys_for_machine = min(max_alloys_for_machine, (stock[metal] + budget // (composition[machine][metal] * cost[metal])) // composition[machine][metal])
                max_alloys = max(max_alloys, max_alloys_for_machine)
        return max_alloys
